import './App.css';
import { FaTimes} from 'react-icons/fa';

function Todo({todo, onDelete}) {  
  return (
      <div className="Todo">
          <p>{todo.title} 
          <FaTimes onClick={() => onDelete(todo.id)}/>
          </p>
      </div>
  );
}

export default Todo;
